import React from 'react';
import Navbar from './Navbar';
import Form from './Form'

function Auth(props) {
    return (
        <div>
            <Navbar />
            <Form title="Signup" type="signup" />
            <Form title="Signin" type="signin" />
        </div>
    )
}

export default Auth;
